// generarBoleta.js
export function generarBoletaPDF() {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    // NÃºmero de boleta aleatorio simulado
    const numeroBoleta = `B001-${String(Math.floor(100000 + Math.random() * 900000))}`;

    // Logo base64 (debes reemplazar por tu imagen real en base64)
    const logoBase64 = 'data:image/png;base64,'; // Agrega aquÃ­ el logo en base64

    // Cabecera con logo, informaciÃ³n de empresa y RUC
    try {
        doc.addImage(logoBase64, 'PNG', 10, 10, 35, 35);
    } catch (error) {
        console.warn("No se pudo cargar el logo:", error);
    }

    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");
    doc.text("INNOVITEX MARBELLIN S.A.C.", 105, 14, { align: "center" });

    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);
    doc.text("Av. PerÃº 123 - La Victoria - Lima", 105, 20, { align: "center" });
    doc.text("Tel: 922 886 724", 105, 25, { align: "center" });
    doc.text("Email: contacto@marbellin.com", 105, 30, { align: "center" });
    doc.text("Web: www.marbellin.com", 105, 35, { align: "center" });

    doc.setFont("helvetica", "bold");
    doc.setFontSize(11);
    doc.rect(150, 10, 50, 25);
    doc.text("R.U.C. 20612345678", 175, 16, { align: "center" });
    doc.text("BOLETA DE VENTA", 175, 22, { align: "center" });
    doc.text("ELECTRÃNICA", 175, 27, { align: "center" });
    doc.text(`NÂº ${numeroBoleta}`, 175, 33, { align: "center" });

    // Datos del cliente
    const nombres = document.getElementById('nombres').value;
    const apellidos = document.getElementById('apellidos').value;
    const correo = document.getElementById('correo').value;
    const dni = document.getElementById('dni').value;
    const telefono = document.getElementById('telefono').value;

    // DirecciÃ³n (si aplica)
    const departamento = document.getElementById('departamento')?.value || '';
    const provincia = document.getElementById('provincia')?.value || '';
    const distrito = document.getElementById('distrito')?.value || '';
    const direccion = document.getElementById('direccion')?.value || '';
    const referencia = document.getElementById('referencia')?.value || '';

    // MÃ©todo de pago
    const metodoPago = document.querySelector('input[name="pago"]:checked')?.value || 'No especificado';

    let y = 45;
    doc.setFontSize(11);
    doc.setFont("helvetica", "bold");
    doc.text("Cliente:", 10, y);
    doc.setFont("helvetica", "normal");
    y += 6; doc.text(`DNI: ${dni}`, 10, y);
    y += 6; doc.text(`Nombre: ${nombres} ${apellidos}`, 10, y);
    y += 6; doc.text(`Correo: ${correo}`, 10, y);
    y += 6; doc.text(`TelÃ©fono: ${telefono}`, 10, y);

    y += 10;
    doc.setFont("helvetica", "bold");
    doc.text("DirecciÃ³n de entrega:", 10, y);
    doc.setFont("helvetica", "normal");
    y += 6; doc.text(`Departamento: ${departamento}`, 10, y);
    y += 6; doc.text(`Provincia: ${provincia}`, 10, y);
    y += 6; doc.text(`Distrito: ${distrito}`, 10, y);
    y += 6; doc.text(`DirecciÃ³n: ${direccion}`, 10, y);
    y += 6; doc.text(`Referencia: ${referencia}`, 10, y);

    y += 8; doc.text(`MÃ©todo de pago: ${metodoPago}`, 10, y);

    // Productos
    const carrito = JSON.parse(localStorage.getItem('carrito')) || [];
    y += 10;
    doc.setFont("helvetica", "bold");
    doc.text("Detalle de productos:", 10, y);
    y += 6;
    doc.setFont("helvetica", "bold");
    doc.text("Cant", 10, y);
    doc.text("DescripciÃ³n", 30, y);
    doc.text("P. Unit", 140, y, { align: 'right' });
    doc.text("Total", 200, y, { align: 'right' });
    doc.setFont("helvetica", "normal");

    let total = 0;
    y += 5;
    carrito.forEach(item => {
        const subtotal = item.precio * item.cantidad;
        total += subtotal;

        doc.text(`${item.cantidad}`, 10, y);
        doc.text(`${item.nombre}`, 30, y);
        doc.text(`S/.${item.precio.toFixed(2)}`, 140, y, { align: 'right' });
        doc.text(`S/.${subtotal.toFixed(2)}`, 200, y, { align: 'right' });
        y += 6;
    });

    // Totales
    const igv = total * 0.18;
    const subtotalSinIGV = total - igv;

    y += 5;
    doc.setFont("helvetica", "bold");
    doc.text(`Subtotal:`, 160, y);
    doc.text(`S/.${subtotalSinIGV.toFixed(2)}`, 200, y, { align: 'right' });
    y += 6; doc.text(`IGV (18%):`, 160, y);
    doc.text(`S/.${igv.toFixed(2)}`, 200, y, { align: 'right' });
    y += 6; doc.text(`TOTAL:`, 160, y);
    doc.text(`S/.${total.toFixed(2)}`, 200, y, { align: 'right' });

    // QR simulado (se puede usar librerÃ­a o imagen real generada)
    // doc.addImage(qrBase64, 'PNG', 160, y + 10, 30, 30);

    // Descargar PDF
    doc.save(`boleta-${numeroBoleta}.pdf`);
}
